package no.nav.tag.tilsagnsbrev.simulator;

import java.util.Base64;

public class EncodedString {

    public final static String ENC_STR = "";

    public static byte[] getEncAsBytes(){
        return ENC_STR.getBytes();
    }

    public static byte[] getDecAsBytes(){
        return Base64.getDecoder().decode(ENC_STR);
    }

    public static String decodet = "";
}
